Test: Table Overflow and Text Wrapping

        /* Reset for consistency */
        * { margin: 0; padding: 0; box-sizing: border-box; }
        body { font-family: 'Arial', sans-serif; font-size: 16px; }

        /* Test-specific CSS */
        .container {
            width: 400px;
            height: 300px;
            border: 2px solid #333;
            padding: 10px;
            overflow: auto;
        }
        table {
            width: 100%;
            table-layout: fixed;
            border-collapse: collapse;
        }
        th, td {
            padding: 8px;
            text-align: left;
            font-size: 12px;
            border: 1px solid #666;
            vertical-align: top;
        }
        th {
            background-color: #e0e0e0;
            font-weight: bold;
        }
        .nowrap-col { 
            white-space: nowrap; 
            overflow: hidden;
            text-overflow: ellipsis;
            background-color: #ffcccc;
            width: 25%;
        }
        .wrap-col { 
            word-wrap: break-word;
            background-color: #ccffcc;
            width: 35%;
        }
        .hidden-col { 
            overflow: hidden;
            background-color: #ccccff;
            width: 40%;
        }







